import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import {AppBar, Tab} from '@material-ui/core/AppBar';

class Navigation extends  Component{
    render() {
        return(
            <AppBar title="My App">
                <Tabs>
                    <Tab label="Item 1" />
                    <Tab label="Item 2" />
                    <Tab label="Item 3" />
                    <Tab label="Item 4" />
                </Tabs>
            </AppBar>
        )
    }
}


export default withRouter(Navigation);
